import React, { Component } from 'react'

class ToDoItem extends Component {

  render() {
    return (
      <div className='todo'>
        <span><input type='checkbox' />
          <h3>{this.props.todo.title}</h3>
        </span>
      </div>
    )
  }
};

export default ToDoItem;
